import Input from "../../component/Input"
import SearchIcon from '@mui/icons-material/Search';
import "aos/dist/aos.css";
import AOS from "aos"
import { useEffect } from "react"
import { Link } from "react-router-dom"


export default function Navbar() {
  

  
  
  useEffect(() => {
    AOS.init({
      duration : 2000
    });
    AOS.init();
  }, []);


  return (
    <Box>
      <AppBar sx={{background:"#212121",textAlign:"center" ,pt:2,pb:2}}>
        <Typography >Summer Sale All Swim Suits And Free Express Delivery - OFF 50%! ShopNow</Typography>
      
      </AppBar>
    </Box>
  )
}
